import React, { useState, useEffect, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../App';
import './css/AdminDashboard.css';

const AdminDashboard = () => {
    const { user, logout } = useAuth();
    const [dashboardData, setDashboardData] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [debugInfo, setDebugInfo] = useState('');

    const navigate = useNavigate();
    const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:8000';

    const fetchData = useCallback(async () => {
        if (!loading) setLoading(true);
        setError(null);
        setDebugInfo('Starting API request...');
        
        try {
            const apiUrl = `${API_BASE_URL}/api/admin/dashboard/`;
            setDebugInfo(`Fetching from: ${apiUrl}`);
            console.log('Fetching admin dashboard data from:', apiUrl);
            
            const response = await fetch(apiUrl, {
                method: 'GET',
                headers: {
                    'Content-Type': 'application/json',
                },
            });
            
            setDebugInfo(`Response status: ${response.status} ${response.statusText}`);
            console.log('Response status:', response.status, response.statusText);
            
            if (!response.ok) {
                const errorText = await response.text();
                console.error('Error response:', errorText);
                throw new Error(`HTTP ${response.status}: ${response.statusText}. ${errorText}`);
            }
            
            const data = await response.json();
            console.log('Dashboard data received:', data);
            setDashboardData(data);
            setDebugInfo('Data loaded successfully');
            
        } catch (err) {
            console.error('Fetch error:', err);
            const errorMessage = err.message;
            
            if (errorMessage.includes('Failed to fetch') || errorMessage.includes('NetworkError')) {
                setError(`Cannot connect to server at ${API_BASE_URL}. Please ensure the Django server is running.`);
                setDebugInfo('Network error - server may be offline');
            } else if (errorMessage.includes('404')) {
                setError(`API endpoint not found. Check if /api/admin/dashboard/ exists in your Django URLs.`);
                setDebugInfo('404 error - endpoint not found');
            } else if (errorMessage.includes('500')) {
                setError(`Server error. Check Django server logs for details.`);
                setDebugInfo('500 error - server internal error');
            } else {
                setError(`Error: ${errorMessage}`);
                setDebugInfo(`Error: ${errorMessage}`);
            }
        } finally {
            setLoading(false);
        }
    }, [API_BASE_URL]);

    useEffect(() => {
        // Check if admin is logged in
        const adminUser = localStorage.getItem('admin_user');
        if (!adminUser) {
            navigate('/admin/login');
            return;
        }
        
        fetchData();
        const interval = setInterval(fetchData, 30000);
        return () => clearInterval(interval);
    }, [fetchData, navigate]);

    // Logout function for admin
    const handleLogout = () => {
        localStorage.removeItem('admin_user');
        navigate('/admin/login');
    };

    // Test server connection
    const testConnection = async () => {
        setDebugInfo('Testing server connection...');
        try {
            const response = await fetch(`${API_BASE_URL}/api/health-check/`);
            if (response.ok) {
                setDebugInfo('Server is reachable. Issue is with admin endpoint.');
            } else {
                setDebugInfo(`Server responded with ${response.status}`);
            }
        } catch (err) {
            setDebugInfo('Cannot reach server - check if Django is running on port 8000');
        }
    };

    if (loading) {
        return (
            <div className="panel-loader">
                <h2>Loading Command Center...</h2>
                <p style={{ marginTop: '10px', color: '#666' }}>{debugInfo}</p>
                <div style={{ marginTop: '20px' }}>
                    <button onClick={testConnection} style={{ padding: '10px 20px', marginRight: '10px' }}>
                        Test Server Connection
                    </button>
                    <button onClick={() => fetchData()} style={{ padding: '10px 20px' }}>
                        Retry
                    </button>
                </div>
            </div>
        );
    }

    if (error) {
        return (
            <div className="error-message">
                <h2>Error Loading Dashboard</h2>
                <p style={{ marginBottom: '10px' }}>{error}</p>
                <p style={{ fontSize: '14px', color: '#666', marginBottom: '20px' }}>Debug: {debugInfo}</p>
                
                <div style={{ marginBottom: '20px' }}>
                    <h3>Troubleshooting Steps:</h3>
                    <ul style={{ textAlign: 'left', marginLeft: '20px' }}>
                        <li>1. Ensure Django server is running: <code>python manage.py runserver</code></li>
                        <li>2. Check if the server is accessible at: <a href={`${API_BASE_URL}/api/health-check/`} target="_blank" rel="noopener noreferrer">{API_BASE_URL}/api/health-check/</a></li>
                        <li>3. Verify the admin dashboard endpoint exists in Django urls.py</li>
                        <li>4. Check Django server console for error messages</li>
                    </ul>
                </div>
                
                <div>
                    <button onClick={fetchData} style={{ padding: '10px 20px', marginRight: '10px' }}>
                        Retry
                    </button>
                    <button onClick={testConnection} style={{ padding: '10px 20px', marginRight: '10px' }}>
                        Test Connection
                    </button>
                    <button onClick={handleLogout} style={{ padding: '10px 20px' }}>
                        Back to Login
                    </button>
                </div>
            </div>
        );
    }
    
    if (!dashboardData) {
        return (
            <div>
                <p>No data available from the server.</p>
                <button onClick={fetchData} style={{ padding: '10px 20px' }}>Retry</button>
            </div>
        );
    }

    const { 
        station_data = {}, 
        registered_users = [], 
        health_assessments = [] 
    } = dashboardData;

    return (
        <div className="main-wrapper">
            <aside className="sidebar">
                <div className="sidebar-header">
                    <h1 className="sidebar-title">AQI Monitoring</h1>
                </div>
                <ul className="nav flex-column">
                    <li className="nav-item"><a className="nav-link active" href="#"><i className="fas fa-tachometer-alt nav-icon"></i><span className="nav-text">Dashboard</span></a></li>
                    <li className="nav-item"><a className="nav-link" href="#"><i className="fas fa-wifi nav-icon"></i><span className="nav-text">Stations</span></a></li>
                    <li className="nav-item"><a className="nav-link" href="#"><i className="fas fa-users nav-icon"></i><span className="nav-text">Registered Users</span></a></li>
                    <li className="nav-item"><a className="nav-link" href="#"><i className="fas fa-heartbeat nav-icon"></i><span className="nav-text">Health Assessments</span></a></li>
                </ul>
            </aside>

            <main className="content-area">
                <div className="topbar">
                    <h1 className="topbar-title">Command Center</h1>
                    <div className="user-dropdown">
                        <div className="user-avatar"><i className="fas fa-user-shield"></i></div>
                        <span className="user-name">Admin</span>
                        <button onClick={handleLogout} style={{ marginLeft: '10px', padding: '5px 10px' }}>
                            Logout
                        </button>
                    </div>
                </div>

                <div className="station-grid">
                    {Object.entries(station_data).map(([id, station]) => (
                        <div className="dashboard-card" key={id}>
                            <div className="card-header">
                                <h5 className="card-title">{station.station_name || id.replace('_', ' ').toUpperCase()}</h5>
                                <span className={`status-badge status-${station.status || 'ONLINE'}`}>{station.status || 'ONLINE'}</span>
                            </div>
                            <div className="card-body">
                                <p><strong>Current AQI:</strong> {Math.round(station.aqi || 0)}</p>
                                <p><strong>Last Updated:</strong> {station.last_updated_on}</p>
                            </div>
                        </div>
                    ))}
                </div>

                <div className="data-card" id="register">
                    <div className="card-header">
                        <h4 className="card-title"><i className="fas fa-users"></i> Registered Users ({registered_users.length})</h4>
                    </div>
                    <div className="card-body p-0">
                        <table className="data-table">
                            <thead><tr><th>ID</th><th>Name</th><th>Phone Number</th></tr></thead>
                            <tbody>
                                {registered_users.map(u => (
                                    <tr key={u.id}><td>#{u.id}</td><td>{u.name}</td><td>{u.phone_number}</td></tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>

                <div className="data-card" id="healthassessment">
                     <div className="card-header"><h4 className="card-title"><i className="fas fa-heartbeat"></i> Health Assessments ({health_assessments.length})</h4></div>
                     <div className="card-body p-0">
                        <table className="data-table">
                            <thead><tr><th>Username</th><th>Age Group</th><th>Score</th></tr></thead>
                            <tbody>
                                {health_assessments.map(h => (
                                    <tr key={h.id}>
                                        <td>{h.user__name}</td>
                                        <td>{h.age_group}</td>
                                        <td>
                                            <span className={`health-score ${h.health_score > 70 ? 'health-score-high' : h.health_score > 40 ? 'health-score-medium' : 'health-score-low'}`}>
                                                {h.health_score}
                                            </span>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </main>
        </div>
    );
};

export default AdminDashboard;
